import React from "react";
import FulsoreLogo from "..//../assets/fulsorelogo.jpeg"; // Correct relative path

function Navbar() {
  console.log(FulsoreLogo); // Check if the image path is correct in the console

  return (
    <div>
      {/* upper Navbar */}
      <div>
        <div>
          <div>
            <a href="#" className="font-bold text-2xl sm:text">
              <img className="w-10" src={FulsoreLogo} alt="LOGO" />{" "}
              {/* Correct usage */}
              Fulsore
            </a>
          </div>
          {/* search bar */}
          <div>
            <div>
              <input
                type="text"
                placeholder="search"
                className="w-[200px] sm:w-[200px] group-hover:w-[300px] transition-all duration-300 rounded-full px-2px py-1 focus:outline-none focus:border-1 focus:border-blue-400"
              ></input>
            </div>
          </div>
        </div>
      </div>
      {/* lower navbar */}
      <div></div>
    </div>
  );
}

export default Navbar;
